import React from 'react';
import { Component } from 'react';

class Temp extends Component{
    state={
        name:null
    };

    onChangeHandler=(event)=>{
        this.setState({
            name:event.target.value
        })
    }
    render(){
        return(
            <input type='text' onChange={this.onChangeHandler}/>
        );
    }
};

export default Temp;
